import React from 'react'

const Events = () => {

    const myfunction = ()=>{
        console.log("clicked")
    }

    return (
        <>
            <h1>hyllo world</h1>
            <button onClick={myfunction}>Click Me</button>
        </>
    )
}

export default Events
